class ListBerita {
  ListBerita({
      String? kategori, 
      List<Data>? data, 
      String? message, 
      num? error,}){
    _kategori = kategori;
    _data = data;
    _message = message;
    _error = error;
}

  ListBerita.fromJson(dynamic json) {
    _kategori = json['kategori'];
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data?.add(Data.fromJson(v));
      });
    }
    _message = json['message'];
    _error = json['error'];
  }
  String? _kategori;
  List<Data>? _data;
  String? _message;
  num? _error;
ListBerita copyWith({  String? kategori,
  List<Data>? data,
  String? message,
  num? error,
}) => ListBerita(  kategori: kategori ?? _kategori,
  data: data ?? _data,
  message: message ?? _message,
  error: error ?? _error,
);
  String? get kategori => _kategori;
  List<Data>? get data => _data;
  String? get message => _message;
  num? get error => _error;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['kategori'] = _kategori;
    if (_data != null) {
      map['data'] = _data?.map((v) => v.toJson()).toList();
    }
    map['message'] = _message;
    map['error'] = _error;
    return map;
  }

}

